// WorkoutDetails.tsx
import React from 'react';
import { Container, Typography, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';

interface WorkoutDetailsProps {
  workoutName: string;
  isLastWorkout: boolean;
  onNextWorkout: () => void;
}

const WorkoutDetails: React.FC<WorkoutDetailsProps> = ({ workoutName, isLastWorkout, onNextWorkout }) => {
  const navigate = useNavigate();

  const handleNextClick = () => {
    if (isLastWorkout) {
      // Handle end workout logic
      navigate('/workout-summary'); // Navigate to workout summary
    } else {
      // Handle next workout logic
      onNextWorkout();
    }
  };

  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 3 }}>
      <Typography variant="h4" color="primary" gutterBottom>
        Workout Details
      </Typography>

      <Typography variant="h5" color="white" paragraph>
        Details for {workoutName}
      </Typography>

      {/* Include additional details or content for the workout as needed */}

      <Button variant="contained" size="large" color="primary" onClick={handleNextClick}>
        {isLastWorkout ? 'End Workout' : 'Next Workout'}
      </Button>
    </Container>
  );
};

export default WorkoutDetails;
